Defendant Emilio C Fregoso in court with attorney Cameron Weitzner.  Bryan C. Bayer appeared for the State of Wisconsin.   Defendant enters a guilty plea to Count 4.  Court finds defendant guilty.  Count #3 is dismissed and read into count #4. 
  The Defendant was sentenced to the following:

Count #4: 

IMPOSED AND STAYED SENTENCE OF:   

30 DAYS JAIL; (apply 4 days Credit if revoked).

TERM OF PROBATION: 1 YEAR; (may be transferred to Milwaukee County);

CONDITIONS OF PROBATION:  
*AODA Assessment and follow through with any treatment recommended;
*Absolute Sobriety;  Random U.A.'s ; 
*No Use or Possession of alcohol, controlled substances or drug paraphernalia.
*No Use or Possession of prescription drugs without a valid prescription;
*Any valid prescription drugs must be taken only in the manner in which they are prescribed.
*Inform Agent of all prescriptions
*Follow through with any treatment and/or counseling recommended by Agent;
*Maintain full time employment and/or combination of schooling 
*No contact with:  co-defendant Michelle Dupor;
*DNA sample to be provided if not yet previously done.
*Defendant to perform 50 Hours Community Service as a condition of probation. Court authorizes credit towards costs/fine to be at the rate of $10.00/hour.  Agent to make any financial adjustments.   

COURT COSTS:  $243.00 (apply cash bail);

DNA SURCHARGE:  $200.00 (apply cash bail and balance to be paid as a condition of probation);

EXPUNCTION: Request for expunction is not granted.
